import React from "react";
import { Element } from "react-scroll";
const Main = ({ children }) => {
    return (
        <main>
            {React.Children.map(children, (child, index) => (
                <Element key={index} name={`section${index}`} className="element">
                    <div
                        style={{
                            flex: "1",
                            minHeight: "100vh",
                            display: "flex",
                            flexDirection: "column",
                        }}
                    >
                        {child}
                    </div>
                </Element>
            ))}
        </main>
    );
};

export default Main;
